reviewText:
By far and away one of the best shows on TV. Talking Dead not so much. I had REAAALY expected to have been givens some clues; story lines;
hints ; something about this "Zombie" disease that everyone can and will get. This may not follow the comic books but come on. Give us something
writers! The CDC guy who told Rick about everyone who dies turns was GREAT. But now we could use a little less weird communities, killing zombie after zombie, show after show,season after season...and would like to learn a little bit more.
